import React from 'react';
import ReactDOM from 'react-dom';
import FriendRequestComponent from './friendRequest';

const rootElement = document.getElementById('friend-request-root');
const profileId = rootElement.getAttribute('data-profile-id');
ReactDOM.render(
  <React.StrictMode>
    <FriendRequestComponent profileId={profileId} />
  </React.StrictMode>,
  rootElement
);
